import React from "react";

class Login extends React.Component {
  constructor() {
    super();
    this.state = {
      email: '',
    }
  }
  render() {
    return (
      <div>
                  <label htmlFor="email">Email</label>
        {" "}
        <div>
          <input
            placeholder="Digite seu email"
            id="email"
            type="text"
            value={this.state.email}
          />

        </div>
      </div>
    );
  }
}

export default Login;
